import './Navbar.css';

import React from 'react'

export default function Navbar() {
  return (
    <div className="navbar">
      <ul className="list">
        <li>
            <p>Students</p>
        </li>
        <li>
            <p>Teachers</p>
        </li>
        <li>
            <p>About the project</p>
        </li>
      </ul>
    </div>
  );
}
